import Foundation

enum SoundAssets {
    static let beacon = ""
    static let chime = ""
    static let radial = ""
    static let signal = ""
    
    static func data(for name: String) -> Data? {
        let b64: String
        switch name {
        case "beacon": b64 = beacon
        case "chime":  b64 = chime
        case "radial": b64 = radial
        case "signal": b64 = signal
        default: return nil
        }
        return Data(base64Encoded: b64, options: .ignoreUnknownCharacters)
    }
}
